// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

contract EnergyD is ERC721URIStorage {
    struct EnergyData {
        uint256 wattHours;
        uint256 timestamp;
        string location;
        string powerPlantType;
    }

    uint256 private s_tokenCounter;

    event edMinted(uint256 indexed tokenId);

    mapping(uint256 => EnergyData) public energyData;

    constructor() ERC721("RenewTrust", "RNT-E") {
        s_tokenCounter = 0;
    }

    function mint(
        address to,
        uint256 wattHours,
        uint256 timestamp,
        string memory location,
        string memory powerPlantType
    ) public {

        _safeMint(to, s_tokenCounter);
        emit edMinted(s_tokenCounter);

        energyData[s_tokenCounter] = EnergyData(wattHours, timestamp, location, powerPlantType);

        // Data
        string memory json = string(
            abi.encodePacked(
                '{"name": "Energy NFT #',
                Strings.toString(s_tokenCounter),
                '", "description": "Represents energy generated by a power plant.", "attributes": [',
                '{"trait_type": "Watt-Hours", "value": ',
                Strings.toString(wattHours),
                '},',
                '{"trait_type": "Timestamp", "value": ',
                Strings.toString(timestamp),
                '},',
                '{"trait_type": "Location", "value": "',
                location,
                '"},',
                '{"trait_type": "Power Plant Type", "value": "',
                powerPlantType,
                '"}',
                ']}',
                '}'
            )
        );

        string memory base64Encoded = Base64.encode(bytes(json));
        string memory tokenURI = string(abi.encodePacked("data:application/json;base64,", base64Encoded)); 

        _setTokenURI(s_tokenCounter, tokenURI);
        s_tokenCounter = s_tokenCounter + 1;
    }

    function getEnergyData(uint256 tokenId) public view returns (EnergyData memory) {
        return energyData[tokenId];
    }

    function getTokenCounter() public view returns (uint256) {
        return s_tokenCounter;
    }    
}
